I'm going to guide you through creating a simple Chrome extension that takes a screenshot of the current webpage and saves it as a file. This extension will use the `chrome.tabs.captureVisibleTab` API to take the screenshot and then save it using the `chrome.downloads.download` API.

1. **Create a new directory** for your extension and navigate into it.

2. **Create a manifest file**: Create a new file named `manifest.json` and add the following content:

```json
{
  "manifest_version": 2,
  "name": "Screenshot Extension",
  "version": "1.0",
  "description": "Takes a screenshot of the current webpage and saves it as a file.",
  "permissions": ["activeTab", "downloads"],
  "background": {
    "scripts": ["background.js"],
    "persistent": false
  },
  "browser_action": {
    "default_icon": "icon.png",
    "default_popup": "popup.html"
  }
}
```

3. **Create a background script**: Create a new file named `background.js` and add the following content:

```javascript
chrome.runtime.onMessage.addListener((request, sender, sendResponse) => {
  if (request.action === 'takeScreenshot') {
    chrome.tabs.captureVisibleTab(null, {}, dataUrl => {
      const blob = dataURLtoBlob(dataUrl);
      const file = new File([blob], 'screenshot.png', { type: 'image/png' });
      chrome.downloads.download({ url: URL.createObjectURL(file) });
    });
  }
});

function dataURLtoBlob(dataURL) {
  const arr = dataURL.split(',');
  const mime = arr[0].match(/:(.*?);/)[1];
  const bstr = atob(arr[1]);
  let n = bstr.length;
  const u8arr = new Uint8Array(n);

  while (n--) {
    u8arr[n] = bstr.charCodeAt(n);
  }

  return new Blob([u8arr], { type: mime });
}
```

4. **Create a popup**: Create a new file named `popup.html` and add the following content:

```html
<!DOCTYPE html>
<html>
  <head>
    <script src="popup.js"></script>
    <style>
      button {
        margin-top: 10px;
      }
    </style>
  </head>
  <body>
    <h1>Screenshot Extension</h1>
    <button id="takeScreenshot">Take Screenshot</button>
  </body>
</html>
```

5. **Create a popup script**: Create a new file named `popup.js` and add the following content:

```javascript
document.getElementById('takeScreenshot').addEventListener('click', () => {
  chrome.runtime.sendMessage({ action: 'takeScreenshot' });
  window.close();
});
